response.about:
С мальчиком Михаилом у учителей и родителей проблем, как правило, не бывает. Он старается все делать хорошо и вовремя. Может участвовать в спортивных играх вместе со своими друзьями и петь в детском хоре. 

Михаилу свойственен логический склад ума. В незнакомой обстановке ориентируется быстро. Болезненно воспринимает критические замечания. Он может получить любую специальность: учителя, юриста, токаря, водителя. Из Михаилов получаются хорошие руководители самого высокого уровня. Удается им карьера и на военной службе. Михаил легок в общении, незлопамятен. Любит возиться с кошками и собаками. С удовольствием проведет время на садовом участке. 

В женщине Михаила привлекают мягкость и отходчивость. Очень добр в отношениях с детьми, не может ни в чем им отказать, балует дорогими игрушками, уделяет все свое свободное время. С вниманием относится к родителям, ухаживает за ними, капризы стариков его не раздражают. Пьет мало. За столом ведет себя свободно. много шутит, любит петь песни. Опьянев, становится сентиментальным. 

Подходят для брака: Александра, Варвара, Вера, Дина, Дина, Елена, Клара, Лидия, Марина, Нина, Раиса, Римма, Тамара, Эльвира. 

Менее подходят: Оксана, Ольга, Софья. 

